contracts/FundMe.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.8;

import "./PriceConvertor.sol";

contract FundMe{
    using PriceConvertor for uint256;
    uint256 public minimumUsd = 50 * 1e18;

    address[] public founders;

    mapping (address => uint256) public addressToAmountFunded;

    function fund() public payable{
        require(msg.value.getConversionRate() >= minimumUsd , "not enough sent!"); //1e18 = 1eth
        founders.push(msg.sender);
        addressToAmountFunded[msg.sender] = msg.value;
    }

    function withdraw ()public {
        for (uint256 i = 0; i < founders.length; i++){
            address founder = founders[i];
            addressToAmountFunded[founder] = 0;
        }
        founders = new address[](0);

        //withdraw the funds

        //automatically revevrts
        //payable(msg.sender).transfer(address(this).balance);

        //returns a bool and should use require to revert
        //bool sendSuccess = payable(msg.sender).send(address(this).balance);
        //require(sendSuccess, "send failed!");

        (bool callSuccess,)=payable(msg.sender).call{value: address(this).balance}("");
        require(callSuccess, "call failed!");

    }
}

contracts/PriceConvertor.sol.content:
// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

library PriceConvertor{
    function getPrice() internal view returns (uint256) {
        //address : 0x8A753747A1Fa494EC906cE90E9f37563A8AF630e
        AggregatorV3Interface dataFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        (,int256 price,,,) = dataFeed.latestRoundData();
        return uint256(price * 1e10);
    }

    function getVersion() internal view returns(uint256){
        AggregatorV3Interface dataFeed = AggregatorV3Interface(0x8A753747A1Fa494EC906cE90E9f37563A8AF630e);
        return dataFeed.version();
    }

    function getConversionRate(uint256 _ethAmount)internal view returns(uint256){
        return (_ethAmount * getPrice()) / 1e18;
    }
}

@chainlink/contracts/src/v0.8/interfaces.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface AggregatorV3Interface {
  function decimals() external view returns (uint8);

  function description() external view returns (string memory);

  function version() external view returns (uint256);

  // getRoundData and latestRoundData should both raise "No data present"
  // if they do not have data to report, instead of returning unset values
  // which could be misinterpreted as actual reported values.
  function getRoundData(uint80 _roundId)
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );

  function latestRoundData()
    external
    view
    returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    );
}

